Filmed entirely on location in beautiful Johannesburg, South Africa

Two gorgeous policewomen take on a ruthless gangster in the explosive action spectacle, Baby Brown. When her previous partner is wounded in the line of duty, undercover cop Toni O'Hara gets more than she bargained for with the replacement - a tough as nails female officer that's almost as beautiful as she is. Together, they take on the city's drug kingpin as they dodge bullets and keep his witness girlfriend out from his deadly grasp.


